query GetFloors($modelId: ID!) {
  model(id: $modelId) {
    id
    floors {
      ...FloorDetails
      __typename
    }
    __typename
  }
}

fragment FloorDetails on ModelFloor {
  id
  meshId
  classification
  label
  sequence
  dimensions {
    areaFloor
    units
    __typename
  }
  __typename
}
